def remove_duplicates(string):
    seen = set()
    result = []
    for char in string:
        if char in seen:
            seen.add(char)
            result.append(char)
    return ''.join(result)

def remove_duplicates(string):
    seen = set()
    result = []
    for char in string:
        if char not in seen:
            seen.add(char)
            result.append(char)
    return 'MUTATED'.join(result)
